script: |
  super -f text -I q8726.spq | sort > q8726.out

inputs:
  - name: q8726.spq
    data: |
      SELECT DISTINCT + col1 * + 99 + - col0 + + + 57 + - col0 * + col2 * + col0 * + - 0 + col1 / col1 * + col0 / + col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT NULL BETWEEN + 64 AND + 90 * col0 - + 46;
  - name: tab1

outputs:
  - name: q8726.out
    data: |
